import { createSlice } from "@reduxjs/toolkit";

const cardslice = createSlice({
  name: "cards",
  initialState: {
    tokenStore: -1,
    
  },
  reducers: {
    OnClickImage(state,action){
      state.ImageDetail=action.payload
    }
  },
});

export const {  } =
  cardslice.actions;
export default cardslice.reducer;
